import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Tooltip from "react-simple-tooltip";
import logo from '../assets/images/logo.png';
import { BrowserRouter, Link, Route } from 'react-router-dom';
import Page from './Page.js';
import '../assets/css/App.css';
import Show from './Show.js';

export default class Header extends React.Component {
    render() {
        return (
        <BrowserRouter>
            <div>
                <nav className="navbar navbar-inverse navbar-light fixed-top" id="mainNav">
                    <ul className="navbar-nav">
                        <li className="nav-item">
                            <Tooltip content="Page" placement="bottom" background="rgb(53, 56, 47)">
                                <Link to="/page/" ><img src={logo} widht="100" height="50" className="d-inline-block align-top" alt="profil" /></Link>
                            </Tooltip>
                        </li>
                    </ul>
                    <span className="navbar-text">
                        JSONPlaceholder
                    </span>
                </nav>
                <div className="main-route-place">
                    <Route exact path="/page/" component={Page} />
                    <Route exact path="/post/:id" component={Show} />
                </div>
            </div>
        </BrowserRouter>
        );
    }
}
